                columnname=>
                    `<tr style="text-align: left;">
                    <th style="padding: 4px; padding-right: 10px;">
                        ${aliases[fields.indexOf(columnname)]
                        }
                    </th>
                    
                    <td style="padding: 4px;">${handleObject(layer.feature.properties[columnname])
                    }</td></tr>`
                ).join(''))
                +'</table>'
            }, {"sticky": true});
        
</script>
